		"id_str": "883705474335391744",
		"text": "그런데 카쿠에게서 나온 답은 장관의 예상 범위에는 전혀 없던 것이라, 장관은 미리 준비해놓은 대사는 말할 수 없었다. 장관은 당황했다. 얘가 지금 뭐라고 말하는거야? 카쿠는 말을 마치고 고개를 푹 숙이고 있었다. 장관은 천천히 말을 곱씹었다.",
