		"text": "장관은 속으로 이를 갈며 그 며칠간 타이밍을 노렸다. 카쿠 이녀석, 언제까지 내가 당하고만 있을거라고 생각하는거야? 그리고 대화의 흐름이 딱 좋았던 그 날, 장관은 카쿠에게 물었다. \n\n넌 날 어쩌다 좋아하게 된거야? 언제부터?",
