		"text": "끝내 카쿠는 아무 말도 하지 못했다. 장관이 안색이 안좋은 것 같다며 왜그러냐고 물었지만 그는 자기도 조금 피곤한 것 같다며 도망치듯 집무실을 빠져나왔을 뿐이었다. 그렇게 제 방에 도착해 침구에 누워 그는 되내었다. 내일은, 내일은 꼭 말해야지.",
