		"text": "얼마 안있어 보좌관이 장관을 부르러 왔고, 카쿠는 그를 깨웠다. 장관은 보좌관에게서 새로운 종이들을 받아들고선 다시 책상에 앉았다. 카쿠는 무거운 발걸음으로 그 앞까지 갔다. 아, 카쿠. 아까는 고마웠어. 장관은 그를 보고 웃었다.",
