		"id_str": "883203510782771200",
		"in_reply_to_user_id": 877195967023403000,
		"text": "카쿠의 손이 허공에서 잠시 갈길을 찾았다. 결국 카쿠는 장관을 바로 눞혀 제 무릎을 베고 자도록 했다. 장관은 그제야 표정을 풀고 색색 소리를 내며 편히 잠에 들었다. 카쿠는 한 동안 고개를 숙이고 장관을 바라만 보았다.",
		"id": 883203510782771200,
		"in_reply_to_status_id": 883202809193037800,
