		"text": "어느 날은 피로한 장관이 카쿠와 차를 마시면서 평소처럼 이야기를 나누던 중 눈을 비볐다. 카쿠는 졸리면 자신이 시간 맞춰 깨워줄테니 조금 자도 괜찮다고 말했다. 장관은 고개를 끄덕이며 앉은채로 눈을 감았다. 그는 잠이 쏟아져 얼마 안가 잠이 들었다.",
