		"text": "목구멍까지 다 거짓말이었다는 말이 올라왔다. 당신은 날 사랑한 적 없다고, 심지어는 작은 애정도 없었을지 모른다고. 사랑을 했던것은 나뿐이었다는 말이 차올랐다. 입을 열려하면 장관이 눈에 들어왔다. 카쿠는 말을 꾸역꾸역 삼켰다.",
