		"id_str": "883001455837237248",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그리하여 장관님의 (잊지도 않은) 카쿠와의 사랑 기억 찾기가 시작되었다. 카쿠는 이대로 계속 해도 괜찮은지 고민했다. 안될것 같았다. 그런데 장관이 의욕이 넘쳤다. 평소에는 삶의 의욕도 바닥을 쳤던 주제에. 좋은 일인지 좋지 않은 일인지 헷갈렸다.",
