		"in_reply_to_user_id": 877195967023403000,
		"text": "갑자기 떠올랐는데 둘이 춤추는 장소는 어딜까. 무의식적으로 고딕양식 특유의 높다란 창문이 있는 밖에 호수가 보이는 노을진 레슨룸 같은 걸 생각했는데 저들은 해가 저물지않는 곳에 있다. 집무실이여도 나쁘진 않겠다.",
