		"text": "RT @dulci_0213: ~두근두근 사법의 탑 추리 대 작전~\n\n휴가를 맞은 CP0들이 쳐들어와 안 그래도 복작복작 하던 와중에 장관이 보좌를 불렀다. 틈날 때 마다 카쿠가 괴롭혀서 도망다니느라 지쳤던 터포키는 올타쿠나ㅏ 외치고 집무실로 달려갔다.",
