		"text": "뭐 그런 해프닝도 한두 번이여야지 여러번 이어지면 이벤트도 아니다. 무용 동작의 순서 숙지는 필수이지요. 우선 기본적인 것들부터 해보지요. 폴어웨이드런, 샷시. 잡은 손은 장관님의 눈과 어깨 사이 높이로 들고...",
