		"text": "다른 발은 토로 세우시고요. 네, 잘 하시네요. 상체는 앞으로 기울이시고- 장관님 솔직히 틀림없이 자세 무너져서 넘어진다. 안 그래도 가까운 거리였는데 받아주느라 완전 붙어있게 되고. 으 잠만 잡고있어봐 하는데 푸딩은 왠지 빨리 떨쳐내려는 것 같고..",
		"id": 882989823572627500,
		"in_reply_to_status_id": 882989751317352400,
		"created_at": "2017-07-06 15:49:13 +0000",
