		"geo": {},
		"id_str": "882989694128070661",
		"in_reply_to_user_id": 877195967023403000,
		"text": "초대장 내용 듣고 넘겨넘겨 하지만 필수참석이고. 또 앓아누워? 하고 고민하는데 푸딩이 장관님, 춤 추실 줄 아시나요? 하고 물어서 자연스레 푸딩한테 춤 배우는 게 되어버렸으면.\n나 간다고 안 했는데.",
