		"id_str": "882989544190038021",
		"in_reply_to_user_id": 877195967023403000,
		"text": "\"장관님. 손을 잡을 때 손목은 꺽지 않습니다.\"\n손을 잡기가 무섭게 푸딩이 손목을 지긋이 눌러 바르게 펴지도록 교정하며 지적했다. 시작부터 막히는데. 존나 막막하네. 내가 이걸 왜 해야하지... 시발 사교회.",
		"id": 882989544190038000,
		"in_reply_to_status_id": 882989479950024700,
