		"text": "고삼이는 빙의 전에도 비관적인 성격이었나요? 아뇨. 라는 문답에서 새삼 깨달았다… 고삼이는 수능 끝났다고 신나서 팔래팔래 달려나갈 정도로 그냥 활기찬 남고딩이었는데…",
