		"geo": {},
		"id_str": "882660825835520000",
		"in_reply_to_user_id": 877195967023403000,
		"text": "터: 건강에도 좋고 맛있는 쥬스를 만들려면 어떻게 해야 할까요?\n\n재: 일단 좋은 땅을 찾아서... 씨를 뿌려야지\n\n터: 오랜 시간이 걸리는군요\n\n(장: 잘했어 재브라!)",
		"id": 882660825835520000,
		"in_reply_to_status_id": 882659069374242800,
		"created_at": "2017-07-05 18:01:54 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
