		"in_reply_to_status_id_str": "882650432652271617",
		"geo": {},
		"id_str": "882651018546126848",
		"in_reply_to_user_id": 877195967023403000,
		"text": "더 긴 침묵이 이어졌다. 장관은 시무룩해져선 자신과 시선을 마주하지 않는 CP0을 보며 무언가 괴리감을 느꼈다. 지금 얘네가 내가 차별을 하고 있다고 말하는건가? 장관은 침묵 속에서 지난 날을 되짚어 보았으나 딱히 별다른걸 느끼진 못했다.",
		"id": 882651018546126800,
		"in_reply_to_status_id": 882650432652271600,
		"created_at": "2017-07-05 17:22:56 +0000",
