		"geo": {},
		"id_str": "882650432652271617",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관은 이해가 안간다는 표정이었다. 아직 애잖아? 그리고 마냥 오냐오냐 하고 있진 않다고, 그 애는 임무도 제대로 수행하고 수련도 꾸준히, 그리고 열심히 하고 있다고 말했다. 잠시 침묵이 감돌고, 그들은 끝내 말했다. 우리한테는 그러지 않지 않았냐고.",
		"id": 882650432652271600,
		"in_reply_to_status_id": 882649564091605000,
		"created_at": "2017-07-05 17:20:36 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
