		"geo": {},
		"id_str": "882649564091604992",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그 애 자체가 마음에 안드는게 아니라 장관이 그 애를 대하는 태도가 마음에 안든다, 고 그는 답했다. 장관이 무슨 소리인지 모르겠다는 표정을 짓자 그들은 답답하다는 듯 말했다. 너무 어리광을 받아주는 것이 아니냐. 오냐오냐 하는게 아니냐. 하고.",
		"id": 882649564091605000,
		"in_reply_to_status_id": 882649039614820400,
		"created_at": "2017-07-05 17:17:09 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
