		"geo": {},
		"id_str": "882649039614820352",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관은 입 다물고 있을까 아니면 말을 할까 고민하다 끝내 입을 열었다. 그 애가 마음에 안들어? 그래. 마음에 안드네. 하고 카쿠가 재빨리 되받아쳤다. 장관은 말을 잃었다. 조금의 텀이 있고서 장관은 되물었다. 왜 마음에 안드는데?",
