		"text": "그들이 집무실을 찾았을 때 집무실에는 장관 혼자였다. 보좌관은 차를 내리러가고 없었다. 그들은 치타가 보이지 않아 꽤 만족했다. 그 치타가 보이면 또 심기가 뒤틀릴 것만 같았다. 왜인지 이유는 알고 있으나 인정하기 싫었다. 그런 애송이를 질투하다니.",
