		"text": "CP9랑 커틀릿 울려고 하고 몇은 울면서 장관님, 하고 있고. 장관님 여기서 미치지 않으면 다행이다... 일부러 생각하지 않으려고 애쓰던 것들이었는데. 그게 꿈이었나? 아니면 이게 꿈인가? 혼란스럽고, 아파서 죽고 싶고.",
