		"text": "시간이 얼마나 지났을까. 주변에서 말소리가 들리는걸 보면 엄마가 TV 드라마나 예능이라도 보고 계시나보네. 하면서 눈을 뜨겠지. 그런데 눈에 보이는건 TV가 아니고 CP9랑 흰 가운을 입은 의사임. 장관님은 이게 뭐지? 하는데 온 몸이 아파.",
