		"text": "암 것도 하기 싫고 해서도 안 된다고 믿고 그냥 쉬는 장관님. 편한 옷 입고 원하는 거 먹고 취미도 만들고 마음이 편하진 않겠지만 건드리면 덧난다는 취지로 최대한 무능하게 눈감고 귀막고 사는 장관님... 이 정도면 혐스일에서 가능한 최대 행복인 듯?",
