		"text": "그렇게 끔찍하게 생각했으니 별로 그립다는 생각은 안들거고. 처음에는 정말 꿈이었나, 하고 의심도 했겠디만 일상생활로 돌아오고, 옆에 있는 가족들과 친구들을 보면서 지난 꿈 속에서의 8년은 점점 희미해질거야.",
