		"text": "장관님 지금 의식 없는 동안 원래 세계 가 있으면 어떡하지... 가족도 만나고 친구도 만나고 정말 수능도 끝났는데 개꿈을 꿨어. 무슨 꿈이 그렇게 생생했지? 내년것 미리 땡겨서 액땜 했다 치자. 하면서 행복한 나날을 보내고 있었는데...",
