		"text": "죽여서 삼도천에 처박혀도 거꾸로 헤엄쳐 나올 것 같다. 만약 루치가 부활부활 열매 먹었다면 찰떡궁합일 듯. 삶과 죽음에 대한 고뇌 없이 열심히 영생을 살겠지... 근데 장관님은 그렇게 못해 (정상인이니까)",
