		"text": "장관님 아 시발 꿈! 하고 일어났는데 마침 수능날이고 앞에선 답안지 걷고있고 책상에 놓여져있는 OMR카드는 백지상태 일때 고삼이의 기분을 서술하시오.[18점]",
