		"text": "사보: 선물을 고를때 상대에게 '네가 가장 원하던걸 샀어. 맞춰봐'같은 말을하면 상대가 원하는 선물을 알수 있데요.\n\n*\n카라멜: 장관님. 제가 장관님 생ㅅ...일 선물을 준비했습니다. 뭔지 맞춰보세요. 장관님이 제일로 원하시던 겁니다.\n장관: 죽음?",
