		"text": "블라썸 오장님 손뼈 금간거보고 그까이꺼 그냥 맞아주면 되지 왜 철괴를 치고 그래요!!하면서 난리치고 루치는 뭔가 착오가 있을거라면서 내가 왜 이 연약한 주먹에 기절하냐고 다시 한번 쳐보라고 했다가 진심펀치 날린 오장님때문에 전치 nn주 나옴(루:",
