		"text": "ㅌ아 루치진짜 개웃겨ㅠㅠㅠㅠㅠㅠㅠㅠㅠ아 절대 자신이 말한게 안이상하다는 자신감ㅠㅠㅠㅠㅠㅠㅠㅠㅠ상대방이 멍해있으면 이해못했냐고ㅋㅋㅋㅋㅋ아ㅋㅋㅋㅋㅋ",
