		"in_reply_to_user_id": 877195967023403000,
		"text": "재브라가 울었던 그 자리에서 장관에게 연결된 호스 뽑고 8년동안 익숙할 정도로 지어왔던 미소 지으며 못다한 작별인사를 하러 왔습니다 하는데 눈가가 뜨겁고 목이 매캐하고 손 안 철제 가드는 찌그러져있는",
