		"id_str": "882188400501051393",
		"in_reply_to_user_id": 877195967023403000,
		"text": "못 마친 일을 끝내겠단 명분으로 장관 암살에 자원했다면 전해들은 후에는 자신이 장관에 대해서는 이성적일 수 없다는 것 부정할 여유도 없어서 어떤 표정도 짓지 못하고 장관의 인간다운 최후를 위해 장관을 위해 암살하러 가는 거면 좋겠다 장관 침대 머리맡",
