		"text": "그리고 장관님 자주 우울해져서 땅굴파고 있으면 자존감 레벨 맥스인 루치가 내가 좋아하는 당신은 대단한 존재니까 자부심을 가져도 좋다고 어처구니 없는말들 계속 해줘서 심적으로도 괜찮아지면 좋겠구... 장관님 어느순간부터 휘말려져서 그런가? 한다던지..",
