		"text": "하지만 계속계속 자기 마음 고백하는 루치에 정신을 차리고보니 사귀고 있었다던가.. 최신화에서 보여준 행동력으로 루치 장관님 건강하게 해주고 세상 고통 다 없애줄것...루치가 장관님 행복하게 해줄게 틀림없다!😇",
