		"text": "아 세상에 나 장관님 김치먹고싶어해서 단체 김장하는 모습 상상했다 장관님 빨간 레이스 앞치마와 그 급식 나눠줄떼하는 삼각모양 모자같은거 쓰고 빠아알간 고무장갑끼고 김장하는겈ㅋㅋㅋㅋㅋㅋㅋ근데 단체 김장이라 장관은 그 주도를 하고 나머지는 명령에 따른다",
