		"text": "아무리생각해도 루치 ㅁㅇ플 스토ㄹ 게임이냐고 ㅅㅂㅠㅠㅠㅠㅠㅠㅠㅠㅠㅠㅠ죽이면 보상딸려오는...쪼렙 학살 존낸 너무하네",
