		"text": "실제로 입에 넣지않아도 됩니다. 현재 의학계에는 비위관 삽입(일명 콧줄)이라고 의식이 없는 환자에게 영양공급하는 호스가 있죠. 악마의 열매정도는 갈아서 주면됩니다.",
