		"in_reply_to_user_id": 877195967023403000,
		"text": "그리고 어차피 식사는 그냥 배고프니까 먹는거고 실질적인 영양은 수액으로 하고 있잖아, 나. 그냥 굶을래. 배고프긴 해도 직접 들어간게 없어서 그런거고 사실 수액 맞았으면 굳이 식사할 필요 없잖아.\n\n위의 소리를 듣고 울먹울먹하는 터포키+CP들...",
