		"id_str": "881574141198872576",
		"in_reply_to_user_id": 877195967023403000,
		"text": "원망의 릴레이가 되어버림: 푸딩←터포키) 장관님이 병들도록 방치하고 고문하고 죽이려 한 죽일놈, 터포키←cp9) 장관 호위를 제 맘대로 없애버린 주제에 연약한 장관을 바쳐 자기 목숨을 구제한 죽일놈. 장관님 아픈 정도를 알 수록 원망은 깊어진다...",
