		"text": "푸딩보좌 시절엔 만능푸딩의 24시간 밀착 감시 겸 보호 덕분에 장관님이 얼마나 아픈지 허약한지 구체적인 정보가 안 새어나갔을 것 같다. 터포키 보좌 맡으며 장관님 우울증 만성통증 무기력증 하나씩 알아가며 엄청 충격이었겠지...",
