		"text": "그래도 지금상황보단 편하겟지\n사망플래그 꽃을 일도 없고, 구를일도 없을테니(아마..?)\n근데 고삼이 진심 빡칠듯ㅋㅋㅋ\n빙의된게 사람도 아니고 동물이라니ㅋ기ㅋ",
