		"text": "현대 에유여도 좋고 원래여도 좋고 쨌든 둘이 사귀고 있을 때 장관님은 침대에 누워서 뒹굴뒹굴하고 루치는 침대 밑에 앉아서 뒹굴거리는거 혹시 떨어질까 막고있어라. 그러다가 벌떡 일어난 장관님이 뜬금없이 루치, 나 네 머리 묶어봐도 돼? 이럴듯.",
