		"in_reply_to_user_id": 877195967023403000,
		"text": "처음에는 자기 이름이 새겨져있는 푸딩 네임 보고 그냥 엇 내이름이 왜? 이런 생각만 했었는데 한 박자 늦게 상황이해하고 경악해서 푸딩 너 네임!! 이래버려.. 현실 도피하면서 진짜 스팬담과 푸딩이 운명의 관계가 아닐까 하던 장관님은 멘붕해버렸다..",
