		"text": "그러다가 이건 '스팬담'의 네임일지도! 해버리겠지..그리고 정말 너무나도 개연성없게도 혁명군 지부에 가게 된 장관님과 마주친 푸딩... 상처때문에 상체를 붕대로 둘둘 감고 있는데 그 사이에 익숙한 자기 이름이 보여서 반응하는 장관님이 보고싶었고..",
