		"in_reply_to_status_id_str": "881329117991362560",
		"geo": {},
		"id_str": "881329842725150720",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관시절에도 그만! 하면 귓등으로도 안듣던 애들이 cp0된 스팬담의 명령도 아닌 말을 들을리가... 살벌하게 장관님 팬 인간 두들겨두는데 장관님이 아니 야,야 그만! 죽이지 마!! 하면 루치가 이제 명령을 내리는 건 나다, 스팬담. 이러는거 보고싶",
		"id": 881329842725150700,
		"in_reply_to_status_id": 881329117991362600,
