		"geo": {},
		"id_str": "881303940469374977",
		"text": "장관님 배 말랑말랑… 막 뭐지 배 나온게 아니라(살이 없어서) 근육이 없어서 배가 말랑했음ㅁ 좋겠다 장관님 허약한 걸 보면 진짜 온몸이 말랑거릴텐데ㅔ 장난삼아 장관님 배나오셨나요?ㅎ 나이가 나이신데 하면서 찔렀다가 편평한데 말랑거려서 꾹꾹이하고…",
