		"geo": {},
		"id_str": "881180048727752705",
		"in_reply_to_user_id": 877195967023403000,
		"text": "옛날 유럽 귀족들이 바나나 까진 것만 먹다가 노란 바나나껍질 보고 놀랐다는 것처럼 장관님도 차려준 밥상만 먹다가 어느날 원재료 (원피스 고유 해산물이라던가) 보고 어 이게 oo야? 처음 봤네 신기하다 그럼 주변인들은 장관님이 더 신기하겠지ㅎ",
		"id": 881180048727752700,
		"in_reply_to_status_id": 881179733173559300,
		"created_at": "2017-07-01 15:57:49 +0000",
