		"geo": {},
		"id_str": "881179315727081472",
		"text": "암것도 못하는 장관님 너무 최고다. 삼십대인데 혼자서는 옷 입을 줄도 모르는 금수저태생 도련님☆이라 보였으면. 사실 원피스 옷+정장이 낯설 뿐이지만 옷시중에 익숙해져 영원히 모름. 옷 밥 돈 같은 일상적인 면에 완벽히 무능할 것 같다.",
