		"text": "장:터ㅍ...해리. 너는 지금 학교에 있어야 하는 시간 아닌가?\n터:저는 장관님의 보좌입니다. 앞으로 24시간 장관님을 모시겠습니다.\n장:(얼척)학교는?\n터:자퇴하겠습니다.\n장:그래도 돼??(너는 지금 시발 해리포터라고)",
