		"text": "개찌질한 장관인 것을 알고 대환장. 해포는 원피스만큼 열심히 보지도 않았고 빙의한 퍼지장관은 아예 노관심이던 인물이라 어떡하지 어떡하지 고민하면서 일단 호그와트 교장실로 감. 플루가루 승차감 시발 토할것같고 사람좋은 표정하고있는 덤블도어랑 곧이어",
		"id": 881157501990748200,
		"in_reply_to_status_id": 881157309954535400,
