		"geo": {},
		"id_str": "881157309954535429",
		"in_reply_to_user_id": 877195967023403000,
		"text": "강한 ㅈ됨을 느낌. 그러다 갑자기 문이 벌컥 열리더니 시커먼 망토입은 사람이 저보고 해리포터가 불법적인 모임을 만들었으니 얼른 가보셔야 한다고 그럼. \n장:(시발 해리포터 시발)\n\n 해리포터 이름을 듣는 순간 상황파악 완료된 고삼이는 여기서도",
		"id": 881157309954535400,
