		"geo": {},
		"id_str": "881156861830905857",
		"in_reply_to_user_id": 877195967023403000,
		"text": "고삼이 빙의시기는 언제로 하지...퍼지 등장씬 따위 모르겠으므로 대충 불사조기사단에서 덤블도어의 군대 들켰을 때로 하자. 고삼이가 눈떠보니 무슨 집무실 같은데였는데, 애니에스로비는 아니고 처음 보는 곳이었음. 8년전의 일이 오버랩되면서 고삼이는",
		"id": 881156861830905900,
