		"text": "해리포터세계관으로 막장이 보고싶어 푸는 썰) 옛날옛적에 퍼지장관한테 고삼이 빙의시키고 싶다고 한 새럼이 바로 나야나..터포키에게 치인 김에 둘다 사이좋게 해포 세계관으로 보내보겠읍니다,, 고삼이는 퍼지 빙의,터포키는 해리포터(!)로 환생(혼파망 와장창",
