		"id_str": "881102123609464832",
		"in_reply_to_user_id": 877195967023403000,
		"text": "비대칭적인 관계성이 푸딩-장관과 비슷한 것 같다. 한 쪽은 믿고, 한 쪽은 의심하고+속이고.\n\n자세히 설명 안 하고 장관님이 미안해, 실수였어~ 라던가 어쩔 수 없었어~ 정도만 말해도 cp9 얘들은 장관을 떠나지 못했을 듯",
