		"geo": {},
		"id_str": "881100805205446657",
		"text": "재브라가 운 거 은근 충격... 하도 장관님 관점에서만 봐서 그런지 cp9이 장관에게 인간적 유대를 느낀다는 게 새삼스러움. 장관이 멀쩡한 상태였으면 한 대 치지 않았을까 생각했는데 아닌 듯. 어설프게라도 변명하고, 사과하면 넘어가줬을 것 같아",
