		"text": "칼: 장관님, 선물입니다\n장: 엩, 뭐야. \n카: 새 교정기구먼, cp0 복장에 어울리는 색으로 만들었다네\n블: 장관님의 교정기가 꽤 낡은 듯 해서 다 함께 돈을 모아 샀습니다. \n장: 어, 어 고맙다... 잘 쓸게.",
