		"in_reply_to_user_id": 877195967023403000,
		"text": "Cp0가 장관님 옷 골라줬으면 좋겠다. 장관님 끌고 우르르 가서 이거 입어보시죠, 아니 이거!! 저것도! 하면서 장관님 cp0 복장 사는 덕후들... 그리고 장시간의 쇼핑에 해탈한 장관님 앞에 선물이라며 단체로 돈 모아서 산 흰색 교정기 내밀어라",
