		"text": "새벽에 장관님이 악몽을 꾸고 일어났다!\n\n푸 : 따뜻한 물을 주며 말없이 곁을 지킨다.\n터 : 안절부절못하다 제 잘못이라며 무릎 꿇는다.\n빙 : 안아주고 괜찮다며 부드럽게 등을 토닥인다.\n루 : 다시 자라고 뒷목을 내리친다(...",
