		"id_str": "880864719048916992",
		"text": "장관님 생각하기에 자기 인생의 최대 불행은 스팬담 몸에 들어가버린 건데 장관님한테 벌어진 온갖 나쁜일은 거진 다 자업자득이었다는 게 웃김. 8년 간 정성스레 꽂은 사망플래그가 만국기마냥 휘날리는데~ 장관님 그거 다 장관님이 자초한 거에요~ (안쓰럽",
